import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import notes from "../notes.js";


function createnote(contact) {
    return (
      <Note
        title={contact.title}
        content={contact.content}
        
      />
    );
  }




function App() {
    return (<div>
    <Header />
    {notes.map(contact =>
(
      <Note
        title={contact.title}
        content={contact.content}
        
      />
      )  )
  }
    <Footer />
    </div>);}


export default App;
